#define BOGI256_NUM_WORD_IN_A_STATE (64)
#define BOGI256_SBOX_ENTRIES (16)

void BOGI256_Set_Sboxes(CNT_t sbox_idx)
{
	int i;
	for (i = 0; i < BOGI256_NUM_WORD_IN_A_STATE; i++)
	{
		int cpy_st_idx = i * BOGI256_SBOX_ENTRIES;
		memcpy(BOGI256_sboxes + cpy_st_idx, BOGI_applicable_sboxes[sbox_idx], sizeof(SBOX_O_WRD_t) * BOGI256_SBOX_ENTRIES);
	}
}


