void BOGI256_info_out(CNT_t OMEGA_TYPE)
{
	int i;
	FILE* ofp;
	char name[256];
	sprintf_s(name, 256, "%s_info.txt", BOGI256.alg_name);
	ofp = fopen(name, "w");
	fprintf(ofp, "%s\n", bogi256_commuting_types_strs[OMEGA_TYPE]);
	for (i = 0; i < BOGI256_NUM_WORD_IN_A_STATE; i++)
	{
		int j;
		for (j = 0; j < BOGI256_SBOX_ENTRIES; j++)
		{
			fprintf(ofp, "%d, ", BOGI256_sboxes[i*BOGI256_SBOX_ENTRIES + j]);
		}
		fprintf(ofp, "\n");
	}
	fclose(ofp);
}

